    public function getAllData(): string
    {
        if (!$this->data) {
            return response()->json(['result' => 'No data exists'], 404);
        }

        return json_encode($this->data);
    }

    public function getChartDataByArgs($cRate = -1, $temp = -1): bool|string
    {
        $cRateNum = floatval($cRate);
        $tempNum = floatval($temp);

        if (!$this->data) {
            return response()->json(['result' => 'No data exists'], 404);
        }

        $searchedData = [];
        $dataSize = count($this->data);

        for ($battery = 0; $battery < $dataSize; $battery++) {
            if ($cRateNum === floatval($this->data[$battery]["parameters"]["C-rate"]) || $cRateNum == -1) {
                if ($tempNum === floatval($this->data[$battery]["parameters"]["Temperature [Â°C]"]) || $tempNum == -1) {
                    $searchedData[$battery]['id'] = "Battery " . $battery + 1;

                    $searchedData[$battery]['parameters']['cRate'] = $this->data[$battery]["parameters"]["C-rate"];
                    $searchedData[$battery]['parameters']['temp'] = $this->data[$battery]["parameters"]["Temperature [Â°C]"];

                    $searchedData[$battery]['metrics']['capacity'] = $this->data[$battery]["metrics"]["Capacity [Ah]"];
                    $searchedData[$battery]['metrics']['energy'] = $this->data[$battery]["metrics"]["Energy [Wh]"];

                    $searchedData[$battery]['outputs']['voltage'] = $this->data[$battery]["outputs"]["Voltage [V]"];
                    $searchedData[$battery]['outputs']['capacity'] = $this->data[$battery]["outputs"]["Capacity [A.h]"];

                }
            }
        }

        return json_encode($searchedData);

    }


